import React from 'react';
import { 
  Box, 
  Paper, 
  Typography, 
  Grid, 
  Card, 
  CardContent,
  Chip,
  Divider
} from '@mui/material';
// import Skeleton from 'react-loading-skeleton';
import 'react-loading-skeleton/dist/skeleton.css';

function ResponseDisplay({ response }) {
  if (!response) return null;

  const { details } = response;

  return (
    <Box sx={{ mb: 2 }}>
      <Paper elevation={3} sx={{ p: 2 }}>
        <Grid container spacing={3}>

          {/* Properties Section */}
          {details.properties && details.properties.properties && (
            <Grid item xs={12} md={6}>
              <Typography variant="h6" gutterBottom>
                Available Properties
              </Typography>
              <Grid container spacing={2}>
                {details.properties.properties.map((property, index) => (
                  <Grid item xs={12} key={index}>
                    <Card className="property-card">
                      <CardContent>
                        <Typography variant="subtitle1">{property}</Typography>
                        <Box sx={{ mt: 1 }}>
                          {details?.negotiation?.market_analysis?.trend && (
                            <Chip 
                              label={`Market: ${details.negotiation.market_analysis.trend}`}
                              size="small"
                              sx={{ mr: 1 }}
                            />
                          )}
                        </Box>
                      </CardContent>
                    </Card>
                  </Grid>
                ))}
              </Grid>
            </Grid>
          )}

          {/* Lifestyle Section */}
          {details.lifestyle && (
            <Grid item xs={12} md={6}>
              <Typography variant="h6" gutterBottom>
                Neighborhood Info
              </Typography>
              <Card>
                <CardContent>
                  {details.lifestyle.pros && (
                    <>
                      <Typography variant="subtitle2" color="primary">
                        Highlights
                      </Typography>
                      <Box sx={{ mb: 2 }}>
                        {details.lifestyle.pros.map((pro, index) => (
                          <Chip 
                            key={index}
                            label={pro}
                            size="small"
                            sx={{ mr: 1, mb: 1 }}
                          />
                        ))}
                      </Box>
                    </>
                  )}
                  <Divider sx={{ my: 2 }} />
                  {details.location?.key_distances && (
                    <>
                      <Typography variant="subtitle2" color="primary">
                        Key Distances
                      </Typography>
                      <Grid container spacing={1} sx={{ mt: 1 }}>
                        {Object.entries(details.location.key_distances).map(([place, distance], index) => (
                          <Grid item xs={6} key={index}>
                            <Typography variant="body2">
                              {place}: {distance}
                            </Typography>
                          </Grid>
                        ))}
                      </Grid>
                    </>
                  )}
                </CardContent>
              </Card>
            </Grid>
          )}

        </Grid>
      </Paper>
    </Box>
  );
}

export default ResponseDisplay;
